/*

SCRIPT DE CREACIÓN DE ENTIDAD CONTRATANTE, PARAMETROS DE LA ENTIDAD Y USUARIOS
PARA EL HOSPITAL DEL CARMEN EN EL PROYECTO SALUD TE INTEGRA

*/

--creamos la entidad contratante
if not exists (select 1 from eco_entidad_contratante where RAZON_SOCIAL = 'HEC')
begin
           ,[FECHA_INICIO_CONTRATO]
           ,[REG_ID]
           ,[COM_ID]
           ,[DIRECCION]
           ,[RESTO_DIRECCION]
           ,[NUMERO_DIRECCION]
           ,[ACTIVO]
           ,[ELIMINADO])
     VALUES
           ('HEC'
           ,GETDATE()
           ,13
           ,30
           ,'No Registrada'
           ,''
           ,''
           ,1
           ,0)

print 'Entidad contratante creada con éxito'
end

declare @id_nuevo_ecol int
set @id_nuevo_ecol = (select id from ECO_ENTIDAD_CONTRATANTE where RAZON_SOCIAL = 'HEC')

if @id_nuevo_ecol > 0 
begin
	--creamos los parametros de ecol

if not exists (select 1 from PRE_PARAMETROS_ECOL where ecol_id = @id_nuevo_ecol)
begin
           ,[ENVIA_CORREO]
           ,[LOGO_UNO]
           ,[LOGO_DOS]
           ,[MUESTRA_LOGO_UNO]
           ,[MUESTRA_LOGO_DOS]
           ,[TOPE_USUARIOS]
           ,[FECHA_TERMINO_CONTRATO]
           ,[ACTIVO]
           ,[ELIMINADO]
           ,[TIENE_VISOR])
     VALUES
           (@id_nuevo_ecol
           ,0
           ,null
           ,null
           ,0
           ,0
           ,800
           ,REPLACE( CONVERT(varchar(50), DATEADD(year, 1, getdate()), 103), '/', '-')
           ,1
           ,0
           ,1)

print 'Parametros creados con éxito'
end
end
